class Submission:
    def __init__(self, user_id, content, submission_date):
        self.user_id = user_id
        self.content = content
        self.submission_date = submission_date
        self.is_valid = False
        self.is_published = False

class Validation:
    @staticmethod
    def validate(submission):
        required_fields = ['user_id', 'content', 'submission_date']
        for field in required_fields:
            if not getattr(submission, field):
                return False
        submission.is_valid = True
        return True

class Logger:
    @staticmethod
    def log(action, user_id):
        print(f"User {user_id} performed action: {action}")

class BrokerSystem:
    def __init__(self):
        self.submissions = []

    def upload_submission(self, submission):
        if Validation.validate(submission):
            self.submissions.append(submission)
            Logger.log("Uploaded Submission", submission.user_id)
        else:
            Logger.log("Failed Validation", submission.user_id)

    def publish_submission(self, submission):
        if submission.is_valid and not submission.is_published:
            submission.is_published = True
            Logger.log("Published Submission", submission.user_id)

    def process_deletions(self, date):
        self.submissions = [s for s in self.submissions if s.submission_date >= date]
        Logger.log("Processed Deletions", "System")

