class UserTesting:
    def __init__(self):
        self.tests = []

    def schedule_testing(self, date, user_id):
        self.tests.append({'date': date, 'user_id': user_id})
        Logger.log("Scheduled User Testing", user_id)

    def report_test_summary(self, summary, agency):
        print(f"Report to {agency}: {summary}")

